    let logoWidth = 50;
    let logoHeight = 20;
    let logoX = doc.internal.pageSize.width - 32 - logoWidth / 2;
    let logoY = footerY - 25;
    const image = logo;
    // Add the image
    // Replace 'logo_url' with the actual URL or data URI of your logo
    doc.addImage(image, "PNG", logoX, logoY, logoWidth, logoHeight);

    // Reset text color to black for the rest of the document
